window.bookSummaryJSON = "<p>In the spirit of his best-selling <i>The 21 Irrefutable Laws of Leadership</i> and <i>The 21 Indispensable Qualities of a Leader</i>, John Maxwell offers thoughts on proven leadership qualities and crucial issues that affect leadership success. These basic principles of success can be applied to business and private life, helping anyone reach their full potential. Twenty-one powerful statements help leaders maximize their assets and overcome their weaknesses, encouraging them to lead with their hearts as well as their minds. Daily entries include sections which help listeners integrate and apply each day's material.</p>"; 
